import React from 'react';
import { Link } from 'react-router-dom';
import useProvider from '../hooks/useProvider';

const Contantside = () => {
  const { note } = useProvider();

  return (
    <div className=" bg-black min-w-[200px]  p-6 rounded-2xl  w-full relative max-h-[80vh]">
      <h2 className="text-2xl capitalize font-gloock">{note && note.title}</h2>
      <p className="mt-8 text-gray-300 text-md">{note && note.note}</p>
      <div className="text-black bg-white h-12 justify-center text-sm absolute bottom-4 right-4 flex place-items-center  w-12 rounded-full">Remove</div>
      <Link to="/add" className="text-black bg-white h-12 justify-center text-sm absolute bottom-4 right-4 flex place-items-center  w-12 rounded-full">
        New
      </Link>
    </div>
  );
};

export default Contantside;
